import React from "react";
import Item from "./Item";
import dashboardIcon from "";  // Путь к иконке

const MainMenu = () => {
  return (  
    <div>
      <Item
        text="Dashboard"
        icon={dashboardIcon}  // Передаем импортированную иконку
        onClick={() => alert("Button clicked!")}
        className="custom-class"
      />
    </div>
  );
};

export default MainMenu;
